import React, { Component} from 'react';
import './App.css';
import image from './cover.jpg';
import menuBar from './Menu';

class App extends Component {
  constructor(menuBar) {
    super(menuBar);
  }
  render() {
  return (
    <div className = "cover" style= {{backgroundImage: `url(${image})`}}>
      <head>
        <title>Judy Zhang</title>
      </head>
      this.menuBar.render();
      <body>
        <ul>
          <li>JZ</li>
          <li>Home</li>
          <li>About Me</li>
          <li>Gallery</li>
         </ul>
        </body>
      </div>
  );
  }
}

export default App;
